import React from "react";

export const Input = ({ref,type,id,name,value,onChange,className}) => {
    return(
        <input
            ref={ref || null}
            type={type || 'text'}
            id={id || null}
            name={name || name}
            value={value || null}
            onChange={(e) => onChange(e.target.value)}
            className={ className || "w-full px-4 py-2 border rounded-md"}
        />
    )
}
